<p>I'm back to it! Easing back into work. Thank you for your continued readership while I recover and figure things out.</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-167</link><author>tech@thehiveworks.com</author><pubDate>Fri, 30 Dec 2016 13:08:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-167</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 166]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-166"><img src="http://www.paranatural.net/comicsthumbs/1481623015-Ch5Pg166.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p><strong>*EDIT* Hey guys! I tired my wrist out doing some other work and need to let it recover, so I don't have an update ready for today. Sorry about that! I'm resting up and will get back to it as soon as I can. Thanks for your understanding!</strong></p>
<p>&nbsp;</p>
<p>Thanks for reading!</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-166</link><author>tech@thehiveworks.com</author><pubDate>Tue, 13 Dec 2016 08:00:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-166</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 165]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-165"><img src="http://www.paranatural.net/comicsthumbs/1481280929-Ch5Pg165.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>Aaand we're back! Medicine cut my strep throat off in the cradle so I'm feeling right as rain. Thanks for the well wishes! See you next time!</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-165</link><author>tech@thehiveworks.com</author><pubDate>Fri, 09 Dec 2016 08:00:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-165</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 164]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-164"><img src="http://www.paranatural.net/comicsthumbs/1480716844-Ch5Pg164.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>Sorry for the wait, thanks for reading!</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-164</link><author>tech@thehiveworks.com</author><pubDate>Fri, 02 Dec 2016 17:12:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-164</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 163]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-163"><img src="http://www.paranatural.net/comicsthumbs/1479496075-Ch5Pg163.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>AAAAAND SCENE. We'll get back to these kids later. See you next time!</p>
<p>(P.S. I hope you all had a good holiday!)</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-163</link><author>tech@thehiveworks.com</author><pubDate>Tue, 29 Nov 2016 00:00:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-163</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 162]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-162"><img src="http://www.paranatural.net/comicsthumbs/1479495814-Ch5Pg162.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>Heads up, <strong>there won't be an update this Friday (I'm visiting family and taking time off for Thanksgiving)! The next page will go up on Tuesday the 29th! </strong>See you then and thanks for reading!</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-162</link><author>tech@thehiveworks.com</author><pubDate>Tue, 22 Nov 2016 00:00:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-162</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 161]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-161"><img src="http://www.paranatural.net/comicsthumbs/1479448747-Ch5Pg161.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>if you turn the other cheek fast enough you can really get some force behind it and use it for offensive striking purposes</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-161</link><author>tech@thehiveworks.com</author><pubDate>Fri, 18 Nov 2016 00:47:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-161</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 160]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-160"><img src="http://www.paranatural.net/comicsthumbs/1479183107-Ch5Pg160.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>Hey guys! I'm coming down with strep throat at the moment, so I'm iffy on if the next page will be on time. Right now I'm planning on doing it, so check back for updates! Thanks for reading!</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-160</link><author>tech@thehiveworks.com</author><pubDate>Mon, 14 Nov 2016 23:08:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-160</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 159]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-159"><img src="http://www.paranatural.net/comicsthumbs/1478843125-Ch5Pg159.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>We're going to another scene next time, one I'm very excited for! There's a lot to look forward to coming up in this chapter and onward, so I hope you will keep checking back. I'll be doing my best to make Paranatural a bright little moment in your week. Thank you very, very much for reading and for sharing your time with me! &lt;3</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-159</link><author>tech@thehiveworks.com</author><pubDate>Fri, 11 Nov 2016 00:25:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-159</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 158]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-158"><img src="http://www.paranatural.net/comicsthumbs/1478580260-Ch5Pg158.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<p>Thanks for reading! :O</p>
]]></description><link>http://www.paranatural.net/comic/chapter-5-page-158</link><author>tech@thehiveworks.com</author><pubDate>Mon, 07 Nov 2016 23:42:00 -0500</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-158</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 157]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-157"><img src="http://www.paranatural.net/comicsthumbs/1478234641-Ch5Pg157.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
