]]></description><link>http://www.paranatural.net/comic/chapter-5-page-157</link><author>tech@thehiveworks.com</author><pubDate>Fri, 04 Nov 2016 00:41:00 -0400</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-157</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 156]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-156"><img src="http://www.paranatural.net/comicsthumbs/1477618510-Ch5Pg156.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
