]]></description><link>http://www.paranatural.net/comic/chapter-5-page-156</link><author>tech@thehiveworks.com</author><pubDate>Thu, 27 Oct 2016 21:31:00 -0400</pubDate><guid>http://www.paranatural.net/comic/chapter-5-page-156</guid></item><item><title><![CDATA[Paranatural - Chapter 5 Page 155]]></title><description><![CDATA[<a href="http://www.paranatural.net/comic/chapter-5-page-155"><img src="http://www.paranatural.net/comicsthumbs/1477362167-Ch5Pg155.png" /><br />New comic!</a><br />Today's News:<br /><!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
